#Requires -PSEdition Core
#Requires -RunAsAdministrator

# Script variables
$SCRIPT_NAME = "Taskbar Setup"
$SCRIPT_LOG  = Join-Path -Path $env:USERPROFILE -ChildPath "dotfiles.log"

# Script values
$registryPath = "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\Taskband"
$explorerPath = Join-Path -Path $env:APPDATA  -ChildPath "Microsoft\Internet Explorer\Quick Launch\User Pinned"
$taskbarPath  = Join-Path -Path $env:DOTFILES -ChildPath "resources\taskbar"
$programs     = @(
    [PSCustomObject]@{
        ShortcutPath = Join-Path -Path $explorerPath -ChildPath "TaskBar\Chrome.lnk"
        TargetPath   = Join-Path -Path $env:PROGRAMFILES -ChildPath "Google\Chrome\Application\chrome.exe"
        IconPath     = Join-Path -Path $taskbarPath -ChildPath "Chrome.ico"
    }
    [PSCustomObject]@{
        ShortcutPath = Join-Path -Path $explorerPath -ChildPath "TaskBar\IntelliJ.lnk"
        TargetPath   = (Resolve-Path -Path "C:\Program Files (x86)\JetBrains\IntelliJ*\bin\idea64.exe").Path
        IconPath     = Join-Path -Path $taskbarPath -ChildPath "IntelliJ.ico"
    }
    [PSCustomObject]@{
        ShortcutPath = Join-Path -Path $explorerPath -ChildPath "ImplicitAppShortcuts\d356105fac5527ef\Steam.lnk"
        TargetPath   = "C:\Program Files (x86)\Steam\steam.exe"
        IconPath     = Join-Path -Path $taskbarPath -ChildPath "Steam.ico"
    }
)

# Logger
function Logger {
    param(
        [Parameter(Mandatory = $false)]
        [ValidateSet("none", "debug", "info", "warn", "error", "fatal")]
        [string]$Level = "none",
        [Parameter(Mandatory = $true)]
        [ValidateNotNullOrEmpty()]
        [string]$Message,
        [Parameter(Mandatory = $false)]
        [string]$Structured
    )

    Start-Process -FilePath gum -ArgumentList "log --file $SCRIPT_LOG --time timeonly --level $Level --prefix ""$SCRIPT_NAME"" --structured ""$Message"" $Structured" -NoNewWindow
}

# Remove taskbar folders
Remove-Item -Path "$explorerPath\ImplicitAppShortcuts" -Recurse -Force
Remove-Item -Path "$explorerPath\TaskBar"              -Recurse -Force
Logger -Level debug -Message "Taskbar folders removed" -Structured "path ""$explorerPath"""

# Create taskbar folders
New-Item -Path "$explorerPath\ImplicitAppShortcuts\d356105fac5527ef" -ItemType Directory -Force
New-Item -Path "$explorerPath\TaskBar"                               -ItemType Directory -Force
Logger -Level debug -Message "Taskbar folders created" -Structured "path ""$explorerPath"""

# Generate taskbar shortcuts
$programs | ForEach-Object {
    if (-not (Test-Path -Path $_.TargetPath)) {
        Logger -Level warn -Message "Target path not found" -Structured "path ""$( $_.TargetPath )"""
        return
    }

    $wScriptObj            = New-Object -ComObject WScript.Shell
    $shortcut              = $wScriptObj.CreateShortcut($_.ShortcutPath)
    $shortcut.TargetPath   = $_.TargetPath
    $shortcut.IconLocation = $_.IconPath
    $shortcut.Save()
    Logger -Level debug -Message "Shortcut generated" -Structured "path ""$( $_.ShortcutPath )"""
}

